        "sirdataPurpose5.description": {
            "en": "If you consent and only if you're using a \u003ca href=\"https://consenthub.utiq.com/pages/privacy-statement#telecom-operators\" target=\"_blank\"\u003esupported internet connection\u003c/a\u003e from a participating telecom operator, you will allow the activation and use of Utiq technology on this website.\n\u003cbr/\u003e\n\u003cbr/\u003e\u003cu\u003eActivation details:\u003c/u\u003e\n\u003cbr/\u003eAs part of the activation of the technology, Utiq confirms this using your IP address. If confirmed, your IP address is shared with your telecom operator to create a pseudonymous identifier (\"Network Signal\"). This is done by matching your IP address to a reference to the telecom account associated with the connection (e.g. telecom account number or mobile number). This identifier is then provided to Utiq, without sharing other personal data. Utiq uses it to operate the technology which involves the creation of additional identifiers, including marketing specific ones, with limited duration, as described in Utiq’s privacy statement. These are stored in your browser along with first party cookies and other device storage information.\n\u003cbr/\u003e\n\u003cbr/\u003e\u003cu\u003eUsage by this website:\u003c/u\u003e\n\u003cbr/\u003eWe only receive the marketing identifiers from Utiq. We use them for activities like personalising ads or content and analytics on this and other websites using the Utiq technology, depending on the consents you gave. They help us understand your browsing behaviour and connect visits across \u003ca href=\"/manage-utiq#manage-utiq-domain-list\" target=\"_blank\"\u003eour website(s)\u003c/a\u003e (only if you agree to the activation of the Utiq technology on each one separately). These identifiers are also shared with partner advertising platforms, where needed to conduct the specific marketing or analytics activities.\n\u003cbr/\u003e\n\u003cbr/\u003e\u003cu\u003eWhat are Utiq privacy controls?\u003c/u\u003e\n\u003cbr/\u003eThe Utiq technology is designed around privacy: it uses minimal personal data, secure, time-limited identifiers, and limits data sharing. Utiq also offers a self-serve privacy portal (“\u003ca href=\"https://consenthub.utiq.com/\" target=\"_\"\u003econsenthub\u003c/a\u003e”) to exercise your privacy rights.\n\u003cbr/\u003e\n\u003cbr/\u003eFor more details, visit \u003ca href=\"https://consenthub.utiq.com/pages/privacy-statement\" target=\"_blank\"\u003eUtiq’s privacy statement\u003c/a\u003e.",
            "fr": "En consentant, et seulement si vous utilisez une \u003ca href=\"https://consenthub.utiq.com/pages/privacy-statement#telecom-operators\" target=\"_blank\"\u003econnexion internet compatible\u003c/a\u003e fournie par un opérateur télécom partenaire vous autoriserez l’activation et l’utilisation de la technologie Utiq sur ce site web.\n\u003cbr/\u003e\n\u003cbr/\u003e\u003cu\u003eDétails sur l’activation:\u003c/u\u003e\n\u003cbr/\u003eDans le cadre de l’activation de la technologie, Utiq vérifie cela en utilisant votre adresse IP, dans ce cas, est envoyée à votre opérateur télécom pour créer un identifiant pseudonyme (“Network Signal”). Cela est fait en liant votre adresse IP à une référence de votre contrat internet (ex: votre numéro de téléphone ou numéro de contrat). Cet identifiant est ensuite transmis à Utiq, sans autre donnée personnelle vous concernant. Utiq l’utilise pour mettre en œuvre sa technologie, qui implique la création d’identifiants supplémentaires à durée limitée, qui seront utilisés à des fins de marketing. Plus de détails disponibles dans la Politique d'information sur les données personnelles d'Utiq. Ces identifiants sont enregistrés sur votre navigateur via des cookies et d’autres moyens de stockage de votre terminal.\n\u003cbr/\u003e\n\u003cbr/\u003e\u003cu\u003eUtilisation par ce site:\u003c/u\u003e\n\u003cbr/\u003eNous recevons d’Utiq uniquement les identifiants marketing. Nous les utilisons pour nos activités de personnalisation de publicité et de contenu et d’analyse sur ce site ainsi que sur \u003ca href=\"/manage-utiq#manage-utiq-domain-list\" target=\"_blank\"\u003enos autres sites web\u003c/a\u003e utilisant la technologie Utiq, sous réserve de vos consentements. Ces identifiants nous aident à déduire vos intérêts via votre navigation sur nos sites web (seulement ceux pour lesquels vous avez consenti à l’activation de la technologie Utiq). Ces identifiants sont aussi partagés avec nos plateformes publicitaires lorsque nécessaire à nos activités de marketing et d’analyses.\n\u003cbr/\u003e\n\u003cbr/\u003e\u003cu\u003eQuels contrôles vous offre Utiq?\u003c/u\u003e\n\u003cbr/\u003eLa technologie Utiq a été conçue pour la protection de vos données: elle utilise seulement les données nécessaires, de façon sécurisée, limitée dans le temps et en minimisant le partage de données. Utiq vous offre également un portail (“\u003ca href=\"https://consenthub.utiq.com/\" target=\"_blank\"\u003econsenthub\u003c/a\u003e”) pour exercer vos droits sur l'usage de vos données personnelles.\n\u003cbr/\u003e\n\u003cbr/\u003ePour plus d'informations, veuillez consulter la \u003ca href=\"https://consenthub.utiq.com/pages/privacy-statement\" target=\"_blank\"\u003ePolitique de protection des données personnelles d’Utiq\u003c/a\u003e."
        },
