            "fr": "Vous pouvez accepter ou refuser que les données collectées ici soient combinées avec celles déjà détenues par nos partenaires pour vous présenter des offres personnalisées sur vos postes de radio et de télévision. Cela inclut des identifiants, des données sociodémographiques, géographiques et comportementales, ainsi que votre adresse IP et votre adresse électronique."
